import React, { useState } from 'react'

const Registration = () => {
    const [Name, setname] = useState('');
    const submit = async () => {
        console.log("submit email!")
        this.props.history.push("/ResetLogin", { state: 'sample data' });
    }
    return (

        <div>
            <form>
                    <input
                        type="text"
                        name="Name"
                        placeholder={'userName'}
                        value={Name}
                        onChange={(emil) => setname(emil.target.value)}
                    />
                <input type="submit" value="Submit" />
            </form>
        </div>
    )
}

export default Registration
